from collections import Counter

class Solution:
    def minDeletions(self, s: str) -> int:
        cntr = Counter(s)
        arr = sorted(cntr.values())
        missing = list()
        res = 0
        k = 0
        #print(arr)
        for i, n in enumerate(arr):
            #print(f'missing, n, res = {missing}, {n}, {res}')
            if n > k + 1:
                for j in range(k+1, n):
                    missing.append(j)
            k = n
            if i == 0:
                continue
            if n == arr[i-1]:
                if len(missing) == 0:
                    res += n
                else:
                    res += n - missing[-1]
                    missing.pop()
        return res

